                'aboutUsContain5': 'ALL ORDERS ARE SHIPPED WORLDWIDE FROM THE BRANDS & LABELS HEADQUARTERS IN BOXES THAT ARE PREPARED WITH MAXIMUM CARE AND USE THE FINEST MATERIALS, FROM THE SIGNATURE SHOE BAGS TO THE PERSONALIZED RIBBON.',
                'aboutUsContain6': 'BRANDSLABELS HAD 1.5 MILLION UNIQUE VISITORS ACCESS THE SITE IN 2008 AND HAS GROWN TO 53 MILLION UNIQUE VISITORS IN 2017. MORE THAN 15% OF ONLINE SALES ARE GENERATED FROM THE UNITED STATES, FOLLOWED BY GERMANY, UK, ITALY, CHINA AND FRANCE.',
                'aboutUsContain7': 'BRANDSLABELS PUSHES THE BOUNDARIES OF THE LUXURY RETAIL LANDSCAPE BOTH ON AND OFFLINE WITH AN ARRAY OF EXCLUSIVE SERVICES AND TRADEMARK INITIATIVES INCLUDING BUY IT FIRST, LUXURY CLUB, SNEAKERS CLUB, LVR PRIVILEGE AND LVR EDITIONS.',
