                'positiveImpactSustainability': 'Positive Impact + Sustainability',
                'thereAreStillMoreThanMSG': 'There are still more than a billion people round the world living in extreme poverty on less than \$1.25 a day. In Thailand alone, more than a million members of hill tribes exist on the margins of society - denied citizenship, shut out of the formal job market and vulnerable to exploitation and trafficking.',
                'atYellowLeafHammocksMsg': 'At Yellow Leaf Hammocks we believe that ethical job creation is an empowering long-term solution to extreme poverty.',
                'insteadOfOrganizingMsg': 'Instead of organizing a patchwork of charitable donations to provide water, nutrition, clothing, etc., we are working directly with families to build a comprehensive, dignified, long-term strategy toward a brighter future. The causes behind systemic poverty are complicated, but long-term financial stability is within reach.',
                'toPutItSimplyMsg': 'To put it simply: By focusing on livelihoods, we can cut out the middle man, get money directly into the hands of smart + resourceful mothers and empower families to tackle their own problems (without being subject to anyone else\'s agenda).',
                'acrossThreeWeavingCommunitiesMsg': 'Across three weaving communities, we are working to create jobs for mothers and build a foundation for positive community transformation. Through flexible, safe prosperity wage weaving work, our artisans are able to lift their families from poverty and debt slavery to the middle class.',
                'creatingJobsForWomenMsg': '** Creating jobs for women is especially important to community transformation - research shows that women will spend up to 90% of their earnings on the health, nutrition and education of their families. Turning women into breadwinners improves their status in the community, builds self-esteem and enables them to pool resources to improve infrastructure.',
                'theFoundationForABrighterFuter': 'The Foundation For a Brighter Futer',
                'theSecurityOfAStableMsg': 'The security of a stable, growing revenue source had a tremendous impact on the village. The Mlabri were able to start a school and build a community center for weaving and socializing. They established one of Thailands first unemployment funds. With increased economic power, they successfully lobbied for citizenship and civil rights, which they were first granted in 2001. Hammock weaving is flexible work, ideal for mothers who can work from home and make their own schedules. Unfortunately, without access to global markets, the demand for hammocks was limited to the Thai tourism season and there was no way to ensure year-round employment.',
                'spreadingLastingChangeTheHammockRrevolution': 'Spreading Lasting Change: The Hammock Rrevolution',
                'thisIsAboutWhereMsg': 'THIS IS about where Yellow Leaf joins the story! Over the past few years, we have worked to develop consistent sales channels, build international partnerships and stabilize operations within the villages.',
                'corollaryEconomicMsg': 'Corollary economic opportunities, like a post office, food preparation and sustainable coffee farming have sprung up to employ those who are not weaving. Our partnership with Kiva has spurred financial training and financial planning, with many weavers opening bank accounts for the first time in their lives!',
                'wWithOurGrowthMsg': 'With our growth continuing to accelerate, we will not only be able to employ all Mlabri weavers year-round, we will also be able to continue to expand and provide training and ongoing employment to hill tribe communities in the surrounding region. Until weaving work and sustainable jobs are available throughout the area, destructive agricultural practices will continue and the exploitative cycle of indentured servitude will not truly end.',
                'throughTheEstablishmentMsg': 'Through the establishment of Yellow Leaf as a global lifestyle brand, the hill tribe villages we partner with will be able to sustain this positive impact and continue to lay the foundation for a brighter future.',
                'enterWebsite': 'Enter Website',
