                'charityContain1suv': 'Every Purchase you Make Will Help Buld a Childs Future.',
                'charityContain2suv': 'Sun & Nat - Works actively to help change the world and every purchase you make on our site helps us do the same. We have partnered with a few charities and would like your suggestions to add the charities and causes which you feel need our help and those which can make a difference to people lives.',
                'charityContain3suv': 'Sun & Nat will donate 3% of the proceeds of every sale to a charity that you choose or to one on our list if you do not choose one. You can further help with donating any additional amount at the checkout.',
                'charityContain4suv': 'If you choose to add 10 dollars we will add further 10 dollars as our contribution in additional to our initial 3% ( subject to a maximum of 10% of the order value).',
                'charityContain5suv': 'Every cent is accounted for and our team works hard to ensure that the money reaches in the right hands.',
                'charityContain6suv': 'We update you every step of the way so you can be satisfied when your contributions has changed and improved lives.',
                'returnProcessTitlesuv': 'Return Process',
                'aboutUsTitlesuv': 'SUV & NAT IS A TOP ONLINE LUXURY FASHION DESTINATION WITH 5 MILLION VISITORS PER MONTH AND WORLDWIDE SHIPPING.',
                'aboutUsContainsuv': 'The website features the best selection of the top established designers as well as young emerging talents. Brandslabels was founded in Florence in the early 1930s, with the opening of the companys eponymous concept store on Via Roma. Online since 1999, the company attributes 90% of total revenue to online sales. To this day it remains a 100% privately owned family business, with the founders grandson, Andrea Panconesi acting as CEO and his daughter, Annagreta Panconesi as Creative Director.',
                'aboutUsContain1suv': 'The site offers a wide selection of clothing, shoes, bags, accessories, luxury home interiors and beauty, with products available for men, women and kids from the most prestigious designers such as Balenciaga, Vetements, Off-White, J.W. Anderson,Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus and more.',
                'aboutUsContain2suv': 'There are currently 200 people from 15 different countries that work to produce and maintain Brandslabels. The site is available in 9 languages: English, Italian, German, Chinese, Russian, Spanish, French, Korean and Japanese. The site is created entirely in-house, with the Florence office housing graphic design, IT, customer service, marketing and buying departments. The stylists and press teams operate from the Suvandnats office in the fashion capital of the world  Milan.',
                'aboutUsContain3suv': 'All orders are shipped worldwide from the Suvandnats headquarters in boxes that are prepared with maximum care and use the finest materials, from the signature shoe bags to the personalized ribbon.',
                'aboutUsContain4suv': 'Suvandnats had 1.5 million unique visitors access the site in 2008 and has grown to 53 million unique visitors in 2017. More than 15% of online sales are generated from the United States, followed by Germany, UK, Italy, China and France.',
                'aboutUsContain5suv': 'Suvandnats pushes the boundaries of the luxury retail landscape both on and offline with an array of exclusive services and trademark initiatives including Buy It First, Luxury Club,Sneakers Club, LVR Privilege and LVR Editions.',
