                'charityContain3': 'En lugar de organizar un mosaico de donaciones de caridad para proporcionar agua, nutricin, ropa, etc., estamos trabajando directamente con las familias para construir una estrategia integral, digna y a largo plazo hacia un futuro ms brillante. Las causas detrs de la pobreza sistmica son complicadas, pero la estabilidad financiera a largo plazo est al alcance.',
                'charityContain4': 'En pocas palabras: al centrarnos en los medios de vida, podemos eliminar al intermediario, obtener dinero directamente en manos de madres inteligentes + ingeniosas y capacitar a las familias para abordar sus propios problemas (sin estar sujetos a la agenda de nadie ms).',
                'charityContain5': 'En tres comunidades de tejido, estamos trabajando para crear empleos para las madres y construir una base para la transformacin de la comunidad positiva. A travs del trabajo flexible y seguro de tejido de \"salario de prosperidad\", nuestros artesanos pueden levantar a sus familias de la pobreza y la esclavitud de la deuda a la clase media.',
                'charityContain6': '** Crear empleos para mujeres es especialmente importante para la transformacin comunitaria: la investigacin muestra que las mujeres gastarn hasta el 90% de sus ganancias en la salud, la nutricin y la educacin de sus familias. Convertir a las mujeres en sostn de la familia mejora su estatus en la comunidad, desarrolla autoestima y les permite agrupar recursos para mejorar la infraestructura.',
