                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Los artculos deben ser devueltos sin daos, sin daos y sin usar, con todas las etiquetas adjuntas y el empaque original incluido.',
                'returnPolicyContain3': 'El calzado y los accesorios deben devolverse con las cajas de marca originales y las bolsas de polvo, donde se proporcionan, y colocarse dentro de una caja externa protectora para el envo.',
                'returnPolicyContain4': 'Al intentar el calzado, tenga cuidado de no marcar las plantas o daar la caja de zapatos.',
                'returnPolicyContain5': 'Si un elemento tiene una etiqueta de seguridad avocica o etiqueta de marca adjunta, debe devolverse con la etiqueta en su original.',
                'returnPolicyContain6': 'Los productos de belleza y cosmticos deben devolverse sin abrir y no usar, con los sellos de cualquier empaque an intacto.',
                'returnPolicyContain7': 'Los artculos de calcetera, lencera y trajes de bao deben devolverse con los sellos de higiene conectados y en envases de productos sin abrir y sin daos, cuando corresponda.',
                'returnPolicyContain8': 'La lencera y el traje de bao solo deben probarse sobre su propia ropa interior. No aceptaremos ningn rendimiento que haya sido usado o sucio.',
                'returnPolicyContain9': 'Las mscaras faciales deben devolverse en su embalaje de productos original, sin abrir y sin daos. Las joyas deben devolverse en la misma condicin en la que lleg, incluidos todos los empaques de marca y documentos proporcionados.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Si realiz un pedido como invitado, puede comenzar su regreso aqu. Para devolver o cancelar un elemento que se ha hecho segn sus especificaciones, consulte nuestra seccin \"Elementos personalizados\" a continuacin para obtener ms informacin.',
                'aboutUsText': 'Sobre nosotros',
                'aboutUsTitle': 'Somos marca y etiquetas',
                'aboutUsContain': 'Explore los 100 de las mejores marcas del mundo',
                'aboutUsContain1': 'Brands & Labels es un destino de moda de lujo en lnea con 5 millones de visitantes por mes y envo mundial.',
                'aboutUsContain2': 'El sitio web presenta la mejor seleccin de los mejores diseadores establecidos, as como los jvenes talentos emergentes. Brands & labels se fund en Florencia a principios de la dcada de 1930, con la apertura de la tienda conceptual homnima de la compaa en Via Roma. En lnea desde 1999, la compaa atribuye el 90% de los ingresos totales a las ventas en lnea. Hasta el da de hoy sigue siendo un negocio familiar 100% privado, con el nieto del fundador, Andrea Panconesi actuando como CEO y su hija, Annagreta Panconesi como directora creativa.',
                'aboutUsContain3': 'El sitio ofrece una amplia seleccin de ropa, zapatos, bolsos, accesorios, interiores de lujo y belleza para el hogar, con productos disponibles para hombres, mujeres y nios de los diseadores ms prestigiosos como Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus y ms.',
                'aboutUsContain4': 'Actualmente hay 200 personas de 15 pases diferentes que trabajan para producir y mantener Brandslabels. El sitio est disponible en 9 idiomas: ingls, italiano, alemn, chino, ruso, espaol, francs, coreano y japons. El sitio se crea completamente internamente, con el diseo grfico de vivienda de Florence Office, TI, servicio al cliente, marketing y departamentos de compra. Los estilistas y los equipos de prensa operan desde la oficina de Brandslabels en la capital mundial de la moda: Miln.',
                'aboutUsContain5': 'Todos los pedidos se envan en todo el mundo desde la sede de las etiquetas de las marcas en cajas que se preparan con el mximo cuidado y usan los mejores materiales, desde las bolsas de zapatos de firma hasta la cinta personalizada.',
                'aboutUsContain6': 'Brandslabels tuvo 1,5 millones de visitantes nicos para acceder al sitio en 2008 y ha crecido a 53 millones de visitantes nicos en 2017. Ms del 15% de las ventas en lnea se generan en los Estados Unidos, seguidos por Alemania, Reino Unido, Italia, China y Francia.',
                'aboutUsContain7': 'Brandslabels empuja los lmites del panorama minorista de lujo tanto dentro como fuera de lnea con una variedad de servicios exclusivos e iniciativas de marca registrada que incluyen Buy It First, Luxury Club, Sneakers Club, LVR Privilege y LVR Editions.',
