                'returnProcessTitlesuv': 'Proceso de retorno',
                'aboutUsTitlesuv': 'SUV & NAT es un destino de moda de lujo en lnea con 5 millones de visitantes por mes y envo mundial.',
                'aboutUsContainsuv': 'El sitio web presenta la mejor seleccin de los mejores diseadores establecidos, as como los jvenes talentos emergentes. Brandslabels se fund en Florencia a principios de la dcada de 1930, con la apertura de la tienda conceptual homnima de la compaa en Via Roma. En lnea desde 1999, la compaa atribuye el 90% de los ingresos totales a las ventas en lnea. Hasta el da de hoy sigue siendo un negocio familiar 100% privado, con el nieto del fundador, Andrea Panconesi actuando como CEO y su hija, Annagreta Panconesi como directora creativa.',
                'aboutUsContain1suv': 'El sitio ofrece una amplia seleccin de ropa, zapatos, bolsos, accesorios, interiores de lujo y belleza para el hogar, con productos disponibles para hombres, mujeres y nios de los diseadores ms prestigiosos como Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus y ms.',
                'aboutUsContain2suv': 'Actualmente hay 200 personas de 15 pases diferentes que trabajan para producir y mantener Brandslabels. El sitio est disponible en 9 idiomas: ingls, italiano, alemn, chino, ruso, espaol, francs, coreano y japons. El sitio se crea completamente internamente, con el diseo grfico de vivienda de Florence Office, TI, servicio al cliente, marketing y departamentos de compra. Los estilistas y los equipos de prensa operan desde la oficina de los Suvandnats en la capital mundial de la moda: Miln.',
                'aboutUsContain3suv': 'Todos los pedidos se envan en todo el mundo desde la sede de Suvandnats en cajas que se preparan con el mximo cuidado y usan los mejores materiales, desde las bolsas de zapatos de firma hasta la cinta personalizada.',
                'aboutUsContain4suv': 'Los Suvandnats tenan 1,5 millones de visitantes nicos para acceder al sitio en 2008 y ha crecido a 53 millones de visitantes nicos en 2017. Ms del 15% de las ventas en lnea se generan en los Estados Unidos, seguido por Alemania, Reino Unido, Italia, China y Francia.',
                'aboutUsContain5suv': 'Suvandnats empuja los lmites del panorama minorista de lujo tanto dentro como fuera de lnea con una variedad de servicios exclusivos e iniciativas de marca registrada que incluyen Buy It First, Luxury Club, Slakers Club, LVR Privilege y LVR Editions.',
