                'charityContain3': 'Invece di organizzare un patchwork di donazioni di beneficenza per fornire acqua, nutrizione, abbigliamento, ecc., Stiamo lavorando direttamente con le famiglie per costruire una strategia completa, dignitosa e a lungo termine verso un futuro pi luminoso. Le cause alla base della povert sistemica sono complicate, ma la stabilit finanziaria a lungo termine  a portata di mano.',
                'charityContain4': 'Per dirla semplicemente: concentrandoci sul sostentamento, possiamo ritagliare l\'uomo di mezzo, ottenere denaro direttamente nelle mani di madri intelligenti + intraprendenti e consentire alle famiglie di affrontare i propri problemi (senza essere soggetti all\'agenda di chiunque altro).',
                'charityContain5': 'In tre comunit di tessitura, stiamo lavorando per creare posti di lavoro per le madri e costruire una base per una trasformazione positiva della comunit. Attraverso un lavoro di tessitura flessibile e sicuro per la \"prosperit\", i nostri artigiani sono in grado di sollevare le loro famiglie dalla povert e dalla schiavit del debito alla classe media.',
                'charityContain6': '** La creazione di posti di lavoro per le donne  particolarmente importante per la trasformazione della comunit: la ricerca mostra che le donne spenderanno fino al 90% dei loro guadagni in materia di salute, alimentazione e istruzione delle loro famiglie. Trasformare le donne in capofamiglia migliora il loro status nella comunit, costruisce l\'autostima e consente loro di raggruppare le risorse per migliorare le infrastrutture.',
