                'positiveImpactSustainability': 'Impatto positivo + sostenibilit',
                'thereAreStillMoreThanMSG': 'Ci sono ancora pi di un miliardo di persone in tutto il mondo che vivono in estrema povert con meno di \$ 1,25 al giorno. Solo nella Thailandia, esistono pi di un milione di membri di trib Hill ai margini della societ - negato la cittadinanza, escluso dal mercato del lavoro formale e vulnerabile allo sfruttamento e al traffico.',
                'atYellowLeafHammocksMsg': 'Alle amache gialle crediamo che la creazione di posti di lavoro etica sia una soluzione a lungo termine a lungo termine alla povert estrema.',
                'insteadOfOrganizingMsg': 'Invece di organizzare un patchwork di donazioni di beneficenza per fornire acqua, nutrizione, abbigliamento, ecc., Stiamo lavorando direttamente con le famiglie per costruire una strategia completa, dignitosa e a lungo termine verso un futuro pi luminoso. Le cause alla base della povert sistemica sono complicate, ma la stabilit finanziaria a lungo termine  a portata di mano.',
                'toPutItSimplyMsg': 'Per dirla semplicemente: concentrandoci sul sostentamento, possiamo ritagliare l\'uomo di mezzo, ottenere denaro direttamente nelle mani di madri intelligenti + intraprendenti e consentire alle famiglie di affrontare i propri problemi (senza essere soggetti all\'agenda di chiunque altro).',
                'acrossThreeWeavingCommunitiesMsg': 'In tre comunit di tessitura, stiamo lavorando per creare posti di lavoro per le madri e costruire una base per una trasformazione positiva della comunit. Attraverso un lavoro di tessitura flessibile e sicuro per la \"prosperit\", i nostri artigiani sono in grado di sollevare le loro famiglie dalla povert e dalla schiavit del debito alla classe media.',
                'creatingJobsForWomenMsg': '** La creazione di posti di lavoro per le donne  particolarmente importante per la trasformazione della comunit: la ricerca mostra che le donne spenderanno fino al 90% dei loro guadagni in materia di salute, alimentazione e istruzione delle loro famiglie. Trasformare le donne in capofamiglia migliora il loro status nella comunit, costruisce l\'autostima e consente loro di raggruppare le risorse per migliorare le infrastrutture.',
                'theFoundationForABrighterFuter': 'La base per un futto pi luminoso',
                'theSecurityOfAStableMsg': 'La sicurezza di una fonte di entrate in crescita stabile ha avuto un impatto enorme sul villaggio. I Mlabri sono stati in grado di iniziare una scuola e costruire un centro comunitario per la tessitura e la socializzazione. Hanno istituito uno dei primi fondi di disoccupazione della Thailandia. Con un maggiore potere economico, hanno fatto pressioni con successo per la cittadinanza e i diritti civili, che sono stati concessi per la prima volta nel 2001. La tessitura delle amache  un lavoro flessibile, ideale per le madri che possono lavorare da casa e fare i loro programmi. Sfortunatamente, senza accesso ai mercati globali, la domanda di amache era limitata alla stagione del turismo tailandese e non c\'era modo di garantire un lavoro tutto l\'anno.',
                'spreadingLastingChangeTheHammockRrevolution': 'Diffusione del cambiamento duraturo: The Hammock Rrevolution',
                'thisIsAboutWhereMsg': 'Si tratta di dove la foglia gialla si unisce alla storia! Negli ultimi anni abbiamo lavorato per sviluppare canali di vendita coerenti, costruire partenariati internazionali e stabilizzare le operazioni all\'interno dei villaggi.',
                'corollaryEconomicMsg': 'Le opportunit economiche corollari, come un ufficio postale, la preparazione alimentare e l\'agricoltura del caff sostenibile, sono sorte per impiegare coloro che non sono intrecciati. La nostra partnership con KIVA ha stimolato la formazione finanziaria e la pianificazione finanziaria, con molti tessitori che aprono i conti bancari per la prima volta nella loro vita!',
                'wWithOurGrowthMsg': 'Con la nostra crescita che continua ad accelerare, non solo saremo in grado di impiegare tutti i tessitori di Mlabri tutto l\'anno, saremo anche in grado di continuare ad espandere e fornire formazione e lavoro in corso alle comunit di Tribe Hill nella regione circostante. Fino a quando i lavori di tessitura e lavori sostenibili saranno disponibili in tutta l\'area, le pratiche agricole distruttive continueranno e il ciclo di sfruttamento della servit indenturata non finir veramente.',
                'throughTheEstablishmentMsg': 'Attraverso l\'istituzione di foglie gialle come marchio di stile di vita globale, i villaggi della Trib Hill con cui collaboriamo saranno in grado di sostenere questo impatto positivo e continuare a gettare le basi per un futuro pi luminoso.',
