                'charityTitlesuv': 'Acquista pi consapevolmente',
                'charityContain1suv': 'Ogni acquisto che fai aiuter il futuro di un bambino.',
                'charityContain2suv': 'Sun & Nat - Funziona attivamente per aiutare a cambiare il mondo e ogni acquisto che fai sul nostro sito ci aiuta a fare lo stesso. Abbiamo collaborato con alcune organizzazioni benefiche e vorremmo che i tuoi suggerimenti aggiungano le organizzazioni benefiche e le cause che ritieni abbiano bisogno del nostro aiuto e di quelli che possono fare la differenza per la vita delle persone.',
                'charityContain3suv': 'Sun & Nat doner il 3% dei proventi di ogni vendita a un ente di beneficenza che scegli o a uno nella nostra lista se non scegli uno. Puoi aiutare ulteriormente a donare qualsiasi importo aggiuntivo alla cassa.',
                'charityContain4suv': 'Se scegli di aggiungere 10 dollari, aggiungeremo altri 10 dollari come nostro contributo in aggiunta al nostro 3% iniziale (soggetto a un massimo del 10% del valore dell\'ordine).',
                'charityContain5suv': 'Ogni centesimo  contabilizzato e il nostro team lavora sodo per garantire che il denaro raggiunga le mani giuste.',
                'charityContain6suv': 'Ti aggiorniamo in ogni fase in modo da poter essere soddisfatto quando i tuoi contributi sono cambiati e migliorati.',
                'returnProcessTitlesuv': 'Processo di ritorno',
                'aboutUsTitlesuv': 'SUV & Nat  una delle migliori destinazioni di moda di lusso online con 5 milioni di visitatori al mese e spedizione in tutto il mondo.',
                'aboutUsContainsuv': 'Il sito Web presenta la migliore selezione dei migliori designer affermati e giovani talenti emergenti. Brandslabels  stata fondata a Firenze nei primi anni \'30, con l\'apertura dell\'omonimo concept store dell\'azienda su Via Roma. Online Dal 1999, l\'azienda attribuisce il 90% delle entrate totali alle vendite online. Fino ad oggi rimane un\'azienda di famiglia di propriet privata al 100%, con il nipote del fondatore, Andrea Panconesi che agisce come CEO e sua figlia, Annagreta Panconesi come direttore creativo.',
                'aboutUsContain1suv': 'Il sito offre una vasta selezione di abbigliamento, scarpe, borse, accessori, interni e bellezza di lusso, con prodotti disponibili per uomini, donne e bambini dei pi prestigiosi designer come Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus e altri.',
                'aboutUsContain2suv': 'Attualmente ci sono 200 persone provenienti da 15 paesi diversi che lavorano per produrre e mantenere marchi. Il sito  disponibile in 9 lingue: inglese, italiano, tedesco, cinese, russo, spagnolo, francese, coreano e giapponese. Il sito  creato interamente internamente, con i dipartimenti grafici di Florence Office Housing, IT, servizio clienti, marketing e acquisto. Gli stilisti e i team di stampa operano dall\'ufficio Suvandnats nella capitale della moda del mondo - Milano.',
                'aboutUsContain3suv': 'Tutti gli ordini vengono spediti in tutto il mondo dal quartier generale di Suvandnats in scatole che sono preparate con la massima cura e usano i migliori materiali, dalle sacche di scarpe firmate al nastro personalizzato.',
                'aboutUsContain4suv': 'Suvandnats ha avuto 1,5 milioni di visitatori unici di accesso al sito nel 2008 ed  cresciuto fino a 53 milioni di visitatori unici nel 2017. Pi del 15% delle vendite online sono generate dagli Stati Uniti, seguito da Germania, Regno Unito, Italia, Cina e Francia.',
                'aboutUsContain5suv': 'Suvandnats spinge i confini del paesaggio al dettaglio di lusso sia su e offline con una serie di servizi esclusivi e iniziative di marchio tra cui Buy It First, Luxury Club, Sneakers Club, LVR Privilege e LVR Editions.',
