                'charityTitlesolo': 'Sperare',
                'charityContain1solo': 'Quando acquisti da noi, aiuti a sostenere un sogno un sogno per dare a un futuro sicuro un ambiente felice e una vita sana.',
                'charityContain2solo': 'Hope  il nostro progetto per dare speranza e opportunit a coloro che ne hanno pi bisogno. Ogni dollaro che spendi sul nostro sito - aiuta a migliorare una vita da qualche parte, dai rifugiati siriani all\'educazione dei bambini in Africa o a fornire acqua pulita, desideriamo e speriamo di rendere il mondo un posto pi uguale.',
                'charityContain3solo': 'Il 2% di ogni vendita effettuata sul nostro sito Web va ad aiutare i pi bisognosi. Puoi anche scegliere di contribuire con qualsiasi ulteriore importo che corrisponderemo oltre al nostro 2%, fino a un massimo del 5% del valore dell\'ordine.',
                'charityContain4solo': 'Cosa c\' di pi? Vieni aggiornato da noi sulla donazione in tutti i dettagli possibili e sai dove sono stati spesi i soldi e come ha contribuito a cambiare una vita.',
