                'charityContain5': 'In drei Webgemeinschaften arbeiten wir daran, Arbeitspltze fr Mtter zu schaffen und eine Grundlage fr eine positive Gemeinschaftsumwandlung aufzubauen. Durch flexible, sichere Wohlstandslohn -Webenarbeit knnen unsere Handwerker ihre Familien von Armut und Schuldensklaverei in die Mittelschicht heben.',
                'charityContain6': '** Die Schaffung von Arbeitspltzen fr Frauen ist besonders wichtig fr die Transformation der Gemeinschaft - Untersuchungen zeigen, dass Frauen bis zu 90% ihres Einkommens fr die Gesundheit, Ernhrung und Bildung ihrer Familien ausgeben werden. Das Umwandeln von Frauen in Ernhrer verbessert ihren Status in der Gemeinde, baut Selbstwertgefhl auf und ermglicht es ihnen, Ressourcen zu bndeln, um die Infrastruktur zu verbessern.',
