                'returnPolicyContain1': 'Returned items must comply with our returns policy:',
                'returnPolicyContain2': 'Die Elemente mssen ungetragen, unbeschdigt und unbenutzt zurckgegeben werden, wobei alle Tags und die Originalverpackung enthalten sind.',
                'returnPolicyContain3': 'Schuhe und Accessoires mssen mit den ursprnglichen Markenksten und Staubbeuteln zurckgegeben werden, wo sie zur Verfgung gestellt und in eine schtzende Auenschachtel fr den Versand gelegt werden.',
                'returnPolicyContain4': 'Achten Sie beim Anprobieren von Schuhen bitte darauf, die Sohlen zu markieren oder den Schuhkarton zu beschdigen.',
                'returnPolicyContain5': 'Wenn ein Artikel ber ein Avoirchic -Sicherheits -Tag oder ein Marken -Tag beigefgt ist, muss es mit dem Tag in seinem Original zurckgegeben werden.',
                'returnPolicyContain6': 'Schnheits- und kosmetische Produkte mssen ungeffnet und unbenutzt zurckgegeben werden, wobei die Dichtungen jeder Verpackung noch intakt sind.',
                'returnPolicyContain7': 'Gemse, Dessous- und Badebekleidungspunkte mssen mit den angeschlossenen Hygienendichtungen und gegebenenfalls in ungeffneten und unbeschdigten Produktverpackungen zurckgegeben werden.',
                'returnPolicyContain8': 'Dessous und Badebekleidung drfen nur ber Ihre eigenen Unterwsche ausprobiert werden. Wir werden keine Renditen akzeptieren, die getragen oder verschmutzt wurden.',
                'returnPolicyContain9': 'Gesichtsmasken mssen in ihrer ursprnglichen, ungeffneten und unbeschdigten Produktverpackung ungetragen zurckgegeben werden. Der Schmuck muss in dem gleichen Zustand zurckgegeben werden, in dem er angekommen ist, einschlielich aller Markenverpackungen und Dokumente.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Wenn Sie als Gast eine Bestellung aufgeben, knnen Sie Ihre Rcksendung hierher beginnen. Um einen Artikel zurckzugeben oder zu stornieren, der zu Ihren Spezifikationen hergestellt wurde, finden Sie weiter unten unseren Abschnitt Customized Elements fr weitere Informationen.',
                'aboutUsText': 'ber uns',
                'aboutUsTitle': 'Wir sind Brand & Etiketten',
                'aboutUsContain': 'Entdecken Sie 100 der besten Marken der Welten',
                'aboutUsContain1': 'Brands & Labels ist ein Top -Online -Luxus -Modeziel mit 5 Millionen Besuchern pro Monat und weltweiter Versand.',
                'aboutUsContain2': 'Die Website bietet die beste Auswahl der besten etablierten Designer sowie junge aufstrebende Talente. Brandslabels wurde in den frhen 1930er Jahren in Florenz gegrndet und erffnete den gleichnamigen Konzeptgeschft des Unternehmens ber die ber Roma. Seit 1999 legt das Unternehmen 90% des Gesamtumsatzes dem Online -Umsatz zurck. Bis heute bleibt es ein 100% iges Familienunternehmen in Privatbesitz. Der Enkel des Grnders fungiert Andrea Panconesi als CEO und seine Tochter Annagreta Panconesi als Creative Director.',
                'aboutUsContain3': 'Die Website bietet eine groe Auswahl an Kleidung, Schuhen, Taschen, Accessoires, Luxus-Heiminnenrumen und Schnheit mit Produkten fr Mnner, Frauen und Kinder von den renommiertesten Designern wie Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus und mehr.',
                'aboutUsContain4': 'Derzeit gibt es 200 Menschen aus 15 verschiedenen Lndern, in denen Markenlabel produziert und gewartet werden. Die Website ist in 9 Sprachen erhltlich: Englisch, Italienisch, Deutsch, Chinesisch, Russisch, Spanisch, Franzsisch, Koreanisch und Japanisch. Die Website wird vollstndig intern erstellt, wobei das Florence Office Housing Graphic Design, IT, Kundenservice, Marketing und Kaufabteilungen. Die Stylisten und Presseteams arbeiten aus dem Brandslabels -Bro in der Modehauptstadt der Welt - Mailand.',
                'aboutUsContain5': 'Alle Bestellungen werden weltweit vom Hauptquartier der Brands -Etiketten in Kisten geliefert, die mit maximaler Pflege hergestellt werden und die besten Materialien verwenden, von den typischen Schuhbeuteln bis zum personalisierten Band.',
                'aboutUsContain6': 'Brandslabels hatte 2008 1,5 Millionen Besucher auf das Gelnde und ist 2017 auf 53 Millionen Besucher angewachsen. Mehr als 15% der Online -Verkufe werden aus den USA generiert, gefolgt von Deutschland, Grobritannien, Italien, China und Frankreich.',
                'aboutUsContain7': 'Brandslabels berschreitet die Grenzen der Luxus -Einzelhandelslandschaft sowohl in als auch offline mit einer Reihe exklusiver Dienstleistungen und Markeninitiativen, darunter Buy It First, Luxury Club, Sneakers Club, LVR Privilege und LVR -Editionen.',
