                'atYellowLeafHammocksMsg': 'Bei Yellow Leaf Hngematten glauben wir, dass die Schaffung von ethischen Arbeitspltzen eine ermchtigende langfristige Lsung fr extreme Armut ist.',
                'insteadOfOrganizingMsg': 'Anstatt ein Flickenteppich von gemeinntzigen Spenden zu organisieren, um Wasser, Ernhrung, Kleidung usw. bereitzustellen, arbeiten wir direkt mit Familien zusammen, um eine umfassende, wrdige und langfristige Strategie fr eine bessere Zukunft aufzubauen. Die Ursachen hinter systemischer Armut sind kompliziert, aber langfristige finanzielle Stabilitt ist in Reichweite.',
                'toPutItSimplyMsg': 'Um es einfach auszudrcken: Indem wir uns auf den Lebensunterhalt konzentrieren, knnen wir den mittleren Mann ausschneiden, Geld direkt in die Hnde von Smart + einfallsreichen Mttern bringen und Familien befhigen, ihre eigenen Probleme anzugehen (ohne der Agenda eines anderen anderen zu unterliegen).',
                'acrossThreeWeavingCommunitiesMsg': 'In drei Webgemeinschaften arbeiten wir daran, Arbeitspltze fr Mtter zu schaffen und eine Grundlage fr eine positive Gemeinschaftsumwandlung aufzubauen. Durch flexible, sichere Wohlstandslohn -Webenarbeit knnen unsere Handwerker ihre Familien von Armut und Schuldensklaverei in die Mittelschicht heben.',
                'creatingJobsForWomenMsg': '** Die Schaffung von Arbeitspltzen fr Frauen ist besonders wichtig fr die Transformation der Gemeinschaft - Untersuchungen zeigen, dass Frauen bis zu 90% ihres Einkommens fr die Gesundheit, Ernhrung und Bildung ihrer Familien ausgeben werden. Das Umwandeln von Frauen in Ernhrer verbessert ihren Status in der Gemeinde, baut Selbstwertgefhl auf und ermglicht es ihnen, Ressourcen zu bndeln, um die Infrastruktur zu verbessern.',
                'theFoundationForABrighterFuter': 'Die Grundlage fr einen helleren Fvere',
                'theSecurityOfAStableMsg': 'Die Sicherheit einer stabilen, wachsenden Einnahmequelle hatte einen enormen Einfluss auf das Dorf. Die MLABRI konnten eine Schule grnden und ein Gemeindezentrum zum Weben und Geselligkeit aufbauen. Sie grndeten eines der ersten Arbeitslosenfonds Thailands. Mit zunehmender wirtschaftlicher Macht setzten sie sich erfolgreich fr Staatsbrgerschaft und Brgerrechte ein, die sie erstmals 2001 gewhrt haben. Das Hngemattenweben ist eine flexible Arbeit, ideal fr Mtter, die von zu Hause aus arbeiten und ihre eigenen Zeitplne erstellen knnen. Leider beschrnkte sich ohne Zugang zu den globalen Mrkten die Nachfrage nach Hngematten auf die thailndische Tourismussaison, und es gab keine Mglichkeit, das ganze Jahr ber eine Beschftigung zu gewhrleisten.',
                'spreadingLastingChangeTheHammockRrevolution': 'Verbreitung dauerhafter Vernderung: Die Hngematten -Entfernung',
                'thisIsAboutWhereMsg': 'Hier geht es darum, wo das gelbe Blatt der Geschichte verbindet! In den letzten Jahren haben wir daran gearbeitet, konsistente Vertriebskanle zu entwickeln, internationale Partnerschaften aufzubauen und den Betrieb in den Drfern zu stabilisieren.',
                'corollaryEconomicMsg': 'Wirtschaftliche Mglichkeiten, wie ein Postamt, die Zubereitung von Speisen und eine nachhaltige Kaffeezucht, haben diejenigen, die nicht weben, eingebrochen. Unsere Partnerschaft mit Kiva hat die Finanzausbildung und die Finanzplanung angeregt. Viele Weber erffnen zum ersten Mal in ihrem Leben Bankkonten!',
                'wWithOurGrowthMsg': 'Da unser Wachstum weiterhin beschleunigt wird, werden wir nicht nur das ganze Jahr ber alle Mlabri-Weavers einsetzen, sondern auch in der Lage sein, weiter zu expandieren und Schulungen und eine kontinuierliche Beschftigung fr die Gemeinden der Hill-Stammes in der umliegenden Region anzubieten. Bis zum Weben von Arbeiten und nachhaltigen Arbeitspltzen im gesamten Gebiet verfgbar sind, werden destruktive landwirtschaftliche Praktiken fortgesetzt und der ausbeuterische Zyklus der indentierten Knechtschaft wird nicht wirklich enden.',
                'throughTheEstablishmentMsg': 'Durch die Einrichtung von Yellow Leaf als globale Lifestyle -Marke wird die Hill Tribe -Drfer, mit denen wir zusammenarbeiten, diese positiven Auswirkungen aufrechterhalten und weiterhin die Grundlage fr eine bessere Zukunft legen.',
