                'charityContain1suv': 'Jeder Kauf, den Sie ttigen, hilft Buld der Zukunft eines Kindes.',
                'charityContain2suv': 'Sun & Nat - arbeitet aktiv, um die Welt zu verndern, und jeder Kauf, den Sie auf unserer Website ttigen, hilft uns, dasselbe zu tun. Wir haben uns mit ein paar Wohlttigkeitsorganisationen zusammengetan und mchten, dass Ihre Vorschlge die Wohlttigkeitsorganisationen und Ursachen hinzufgen, die Sie fr unsere Hilfe und diejenigen brauchen, die fr das Leben der Menschen einen Unterschied machen knnen.',
                'charityContain3suv': 'Sun & Nat spendet 3% des Erlses fr jeden Verkauf an eine von Ihnen ausgewhlte Wohlttigkeitsorganisation oder an eine auf unserer Liste, wenn Sie keine auswhlen. Sie knnen bei der Kasse weiter helfen, einen zustzlichen Betrag zu spenden.',
                'charityContain4suv': 'Wenn Sie 10 Dollar hinzufgen mchten, werden wir weitere 10 Dollar als unseren Beitrag zu unseren ersten 3% (vorbehaltlich von maximal 10% des Bestellwerts) hinzufgen.',
                'charityContain5suv': 'Jeder Cent wird bercksichtigt und unser Team arbeitet hart, um sicherzustellen, dass das Geld in den richtigen Hnden reicht.',
                'charityContain6suv': 'Wir aktualisieren Sie jeden Schritt des Weges, damit Sie zufrieden sein knnen, wenn sich Ihre Beitrge verndert und das Leben verbessert haben.',
                'returnProcessTitlesuv': 'Rckgabeprozess',
                'aboutUsTitlesuv': 'SUV & NAT ist ein Top -Online -Luxus -Modeziel mit 5 Millionen Besuchern pro Monat und weltweit Versand.',
                'aboutUsContainsuv': 'Die Website bietet die beste Auswahl der besten etablierten Designer sowie junge aufstrebende Talente. Brandslabels wurde in den frhen 1930er Jahren in Florenz gegrndet und erffnete den gleichnamigen Konzeptgeschft des Unternehmens ber die ber Roma. Seit 1999 legt das Unternehmen 90% des Gesamtumsatzes dem Online -Umsatz zurck. Bis heute bleibt es ein 100% iges Familienunternehmen in Privatbesitz. Der Enkel des Grnders fungiert Andrea Panconesi als CEO und seine Tochter Annagreta Panconesi als Creative Director.',
                'aboutUsContain1suv': 'Die Website bietet eine groe Auswahl an Kleidung, Schuhen, Taschen, Accessoires, Luxus-Heiminnenrumen und Schnheit mit Produkten fr Mnner, Frauen und Kinder von den renommiertesten Designern wie Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus und mehr.',
                'aboutUsContain2suv': 'Derzeit gibt es 200 Menschen aus 15 verschiedenen Lndern, in denen Markenlabel produziert und gewartet werden. Die Website ist in 9 Sprachen erhltlich: Englisch, Italienisch, Deutsch, Chinesisch, Russisch, Spanisch, Franzsisch, Koreanisch und Japanisch. Die Website wird vollstndig intern erstellt, wobei das Florence Office Housing Graphic Design, IT, Kundenservice, Marketing und Kaufabteilungen. Die Stylisten und Presseteams arbeiten aus dem Bro von Suvandnats in der Modeladung der Welt - Mailand.',
                'aboutUsContain3suv': 'Alle Bestellungen werden weltweit aus dem Hauptquartier von Suvandnats in Kisten geliefert, die mit maximaler Pflege hergestellt werden und die besten Materialien verwenden, von den typischen Schuhbeuteln bis zum personalisierten Band.',
                'aboutUsContain4suv': 'Suvandnats hatte 2008 1,5 Millionen Besucher auf das Gelnde und ist 2017 auf 53 Millionen Besucher angewachsen. Mehr als 15% der Online -Verkufe werden aus den USA generiert, gefolgt von Deutschland, Grobritannien, Italien, China und Frankreich.',
                'aboutUsContain5suv': 'Suvandnats berschreitet die Grenzen der Luxus -Einzelhandelslandschaft sowohl in als auch offline mit einer Reihe exklusiver Dienstleistungen und Markeninitiativen, darunter Buy It First, Luxury Club, Sneakers Club, LVR Privilege und LVR -Editionen.',
