                'charityTitlesolo': 'Hoffnung',
                'charityContain1solo': 'Wenn Sie bei uns kaufen, helfen Sie dabei, einen Traum zu untersttzen, einer sicheren Zukunft ein glckliches Umfeld und ein gesundes Leben zu geben.',
                'charityContain2solo': 'Hoffnung ist unser Projekt, um denjenigen, die es am meisten brauchen, Hoffnung und Mglichkeiten zu geben. Jeder Dollar, den Sie auf unserer Website ausgeben - hilft, ein Leben irgendwo zu verbessern, von syrischen Flchtlingen bis hin zur Erziehung von Kindern in Afrika oder zur Bereitstellung sauberer Wasser, wir wnschen uns, die Welt zu einem gleichen Ort zu machen.',
                'charityContain3solo': '2% aller auf unserer Website gettigten Verkaufsanlagen helfen den Bedrftigen, die am meisten bedrftig sind. Sie knnen sich auch dafr entscheiden, einen weiteren Betrag beizutragen, den wir zustzlich zu unseren 2% bis maximal 5% des Bestellwerts bereinstimmen.',
