                'returnPolicyContain7solo': '6. Hosiery, lingerie and swimwear items must be returned with the hygiene seals attached and in unopened and undamaged product packaging, where applicable.',
                'returnPolicyContain8solo': '7. Lingerie and swimwear must only be tried on over your own undergarments. We will not accept any returns that have been worn or are soiled.',
                'returnPolicyContain9solo': '8. Face masks must be returned unworn in their original, unopened and undamaged product packaging.',
                'returnPolicyContain12': '9. Schmuck muss in dem gleichen Zustand zurckgegeben werden, in dem er angekommen ist, einschlielich aller Markenverpackungen und Dokumente, die damit zur Verfgung stehen.',
                'aboutUsContain1solo': 'Solo ist ein Top -Online -Luxuryfashion -Ziel mit 5 Millionen Besuchern pro Monat und weltweit Versand.',
                'aboutUsContain2solo': 'Die Website bietet die beste Auswahl an thetop etablierten Designern und jungen aufstrebenden Talenten. Solo wurde in den frhen 1930er Jahren in Florenz gegrndet, wobei das Unternehmen seit 1999 den gleichnamigen Concept Store fr Via Roma.online erffnet. Das Unternehmen fhrt 90% des Gesamtumsatzes auf Online -Verkufe zu. Bis heute bleibt es ein 100% iges Familienunternehmen in Privatbesitz. Der Enkel des Grnders fungiert Andrea Panconesi als CEO und seine Tochter Annagreta Panconesi als Creative Director.',
                'aboutUsContain3solo': 'Die Website bietet eine groe Auswahl an Kleidung, Schuhen, Taschen, Accessoires, Luxushome-Innenrumen und Schnheit, mit Produkten fr Mnner, Frauen und Kinder von den renommiertesten Designern wie Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus und mehr.',
                'aboutUsContain4solo': 'Derzeit gibt es 200 Menschen aus 15 verschiedenen Lndern, in denen Solo produziert und aufrechterhalten wird. Die Website ist in 9 Sprachen erhltlich: Englisch, Italienisch, Deutsch, Chinesisch, Russisch, Spanisch, Franzsisch, Koreanisch und Japanisch. Die Website wird vollstndig intern erstellt, wobei das Florence Office Housing Graphic Design, IT, Kundenservice, Marketing und Kaufabteilungen. Die Stylisten und Presseteams arbeiten aus dem Solo -Bro in der Modeladung der Welt - Mailand.',
                'aboutUsContain5solo': 'Alle Bestellungen werden weltweit aus dem Solo -Hauptquartier in Kisten geliefert, die mit maximaler Pflege hergestellt werden und die feinsten Materialien verwenden, von den Signature -Schuhbeuteln bis zum personalisierten Band.',
                'aboutUsContain6solo': 'Solo hatte im Jahr 2008 1,5 Millionen eindeutige Besucher auf das Gelnde und ist 2017 auf 53 Millionen Besucher angewachsen. Mehr als 15% der Online -Verkufe werden aus den USA generiert, gefolgt von Deutschland, Grobritannien, Italien, China und Frankreich.',
