                'charityContain4': 'Pour le dire simplement: en nous concentrant sur les moyens de subsistance, nous pouvons couper l\'homme du milieu, mettre de l\'argent directement entre les mains de mres intelligentes + ingnieuses et permettre aux familles de s\'attaquer  leurs propres problmes (sans tre soumis  l\'ordre du jour de quelqu\'un d\'autre).',
                'charityContain5': 'Dans trois communauts de tissage, nous travaillons  crer des emplois pour les mres et  construire une base pour une transformation de la communaut positive. Grce  un travail de tissage flexible et sr de salaire de prosprit, nos artisans sont capables de lever leur famille de la pauvret et de l\'esclavage de la dette  la classe moyenne.',
                'charityContain6': '** Crer des emplois pour les femmes est particulirement important pour la transformation de la communaut - la recherche montre que les femmes dpenseront jusqu\' 90% de leurs gains sur la sant, la nutrition et l\'ducation de leur famille. Transformer les femmes en soutiens de famille amliore leur statut dans la communaut, renforce l\'estime de soi et leur permet de mettre en commun les ressources pour amliorer les infrastructures.',
