                'positiveImpactSustainability': 'Impact positif + durabilit',
                'thereAreStillMoreThanMSG': 'Il y a encore plus d\'un milliard de personnes dans le monde vivant dans l\'extrme pauvret avec moins de 1,25 \$ par jour. Rien qu\'en Thalande, plus d\'un million de membres des tribus Hill existent en marge de la socit - ni citoyennet, exclu du march du travail officiel et vulnrable  l\'exploitation et  la traite.',
                'atYellowLeafHammocksMsg': 'Chez Yellow Leaf Hamacs, nous pensons que la cration d\'emplois thique est une solution  long terme stimulante  l\'extrme pauvret.',
                'insteadOfOrganizingMsg': 'Au lieu d\'organiser un patchwork de dons de bienfaisance pour fournir de l\'eau, de la nutrition, des vtements, etc., nous travaillons directement avec les familles pour construire une stratgie complte, digne et  long terme vers un avenir meilleur. Les causes derrire la pauvret systmique sont compliques, mais la stabilit financire  long terme est  porte de main.',
                'toPutItSimplyMsg': 'Pour le dire simplement: en nous concentrant sur les moyens de subsistance, nous pouvons couper l\'homme du milieu, mettre de l\'argent directement entre les mains de mres intelligentes + ingnieuses et permettre aux familles de s\'attaquer  leurs propres problmes (sans tre soumis  l\'ordre du jour de quelqu\'un d\'autre).',
                'acrossThreeWeavingCommunitiesMsg': 'Dans trois communauts de tissage, nous travaillons  crer des emplois pour les mres et  construire une base pour une transformation de la communaut positive. Grce  un travail de tissage flexible et sr de salaire de prosprit, nos artisans sont capables de lever leur famille de la pauvret et de l\'esclavage de la dette  la classe moyenne.',
                'creatingJobsForWomenMsg': '** Crer des emplois pour les femmes est particulirement important pour la transformation de la communaut - la recherche montre que les femmes dpenseront jusqu\' 90% de leurs gains sur la sant, la nutrition et l\'ducation de leur famille. Transformer les femmes en soutiens de famille amliore leur statut dans la communaut, renforce l\'estime de soi et leur permet de mettre en commun les ressources pour amliorer les infrastructures.',
                'theFoundationForABrighterFuter': 'La fondation pour un futur plus brillant',
                'theSecurityOfAStableMsg': 'La scurit d\'une source de revenus stable et croissante a eu un impact norme sur le village. Les Mlabri ont pu dmarrer une cole et construire un centre communautaire pour le tissage et la socialisation. Ils ont cr l\'un des premiers fonds de chmage de la Thalande. Avec une puissance conomique accrue, ils ont russi  faire pression pour la citoyennet et les droits civils, qu\'ils ont t accords pour la premire fois en 2001. Le tissage de hamac est un travail flexible, idal pour les mres qui peuvent travailler  domicile et faire leurs propres horaires. Malheureusement, sans accs aux marchs mondiaux, la demande de hamacs s\'est limite  la saison du tourisme thalandais et il n\'y avait aucun moyen d\'assurer l\'emploi toute l\'anne.',
                'spreadingLastingChangeTheHammockRrevolution': 'Rpartir le changement durable: la rrvolution du hamac',
                'thisIsAboutWhereMsg': 'C\'est l o Yellow Leaf rejoint l\'histoire! Au cours des dernires annes, nous avons travaill pour dvelopper des canaux de vente cohrents, tablir des partenariats internationaux et stabiliser les oprations au sein des villages.',
                'corollaryEconomicMsg': 'Les opportunits conomiques corollaires, comme un bureau de poste, la prparation des aliments et la culture durable du caf ont vu le jour pour employer ceux qui ne sont pas tisss. Notre partenariat avec Kiva a stimul une formation financire et une planification financire, de nombreux tisserands ouvrant des comptes bancaires pour la premire fois de leur vie!',
                'wWithOurGrowthMsg': 'Avec notre croissance qui continue de s\'acclrer, nous serons non seulement en mesure d\'employer tous les tisserands MLABRI toute l\'anne, mais nous pourrons galement continuer  se dvelopper et  fournir une formation et un emploi continu aux communauts de tribu des collines dans la rgion environnante. Jusqu\' ce que les travaux de tissage et les emplois durables soient disponibles dans toute la rgion, les pratiques agricoles destructrices se poursuivront et le cycle d\'exploitation de la servitude sous contrat ne prendra pas vraiment fin.',
                'throughTheEstablishmentMsg': 'Grce  la cration de Yellow Leaf en tant que marque mondiale de style de vie, les villages Hill Tribe avec lesquels nous nous associons pourront soutenir cet impact positif et continuer  jeter les bases d\'un avenir meilleur.',
