                'returnProcessTitlesuv': 'Processus de retour',
                'aboutUsTitlesuv': 'SUV & NAT est une destination de mode de luxe en ligne avec 5 millions de visiteurs par mois et l\'expdition mondiale.',
                'aboutUsContainsuv': 'Le site Web prsente la meilleure slection des meilleurs designers tablis ainsi que de jeunes talents mergents. Brandslabels a t fonde  Florence au dbut des annes 1930, avec l\'ouverture du concept store ponyme de la socit sur Via Roma. En ligne depuis 1999, la socit attribue 90% du total des revenus aux ventes en ligne.  ce jour, il reste une entreprise familiale prive  100%, avec le petit-fils du fondateur, Andrea Panonesi agissant en tant que PDG et sa fille, Annagreta Panconesi en tant que directrice crative.',
                'aboutUsContain1suv': 'Le site propose une large slection de vtements, de chaussures, de sacs, d\'accessoires, d\'intrieurs de maison de luxe et de beaut, avec des produits disponibles pour les hommes, les femmes et les enfants des designers les plus prestigieux tels que Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus et plus encore.',
                'aboutUsContain2suv': 'Il y a actuellement 200 personnes de 15 pays diffrents qui travaillent pour produire et maintenir des marques de marque. Le site est disponible en 9 langues: anglais, italien, allemand, chinois, russe, espagnol, franais, coren et japonais. Le site est cr entirement en interne, avec la conception graphique de Florence Office, l\'informatique, le service client, le marketing et l\'achat. Les stylistes et les quipes de presse oprent du bureau de Suvandnats dans la capitale de la mode du monde - Milan.',
                'aboutUsContain3suv': 'Toutes les commandes sont expdies dans le monde entier du sige social de Suvandnats dans des botes prpares avec un maximum de soins et utilisent les meilleurs matriaux, des sacs de chaussures signature au ruban personnalis.',
                'aboutUsContain4suv': 'Les Suvandnats comptaient 1,5 million de visiteurs uniques accder au site en 2008 et sont passs  53 millions de visiteurs uniques en 2017. Plus de 15% des ventes en ligne sont gnres  partir des tats-Unis, suivis par l\'Allemagne, le Royaume-Uni, l\'Italie, la Chine et la France.',
                'aboutUsContain5suv': 'Suvandnats repousse les limites du paysage de la vente au dtail de luxe sur et hors ligne avec une gamme de services exclusifs et d\'initiatives de marque, notamment Buy It First, Luxury Club, Sneakers Club, LVR Privilege et LVR Editions.',
