                'returnPolicyContain4': 'Wanneer u schoenen probeert, zorg er dan voor dat u de zolen niet markeert of de schoenendoos beschadigt.',
                'returnPolicyContain5': 'Als een item een avoirchische beveiligingslabel of merktag is bijgevoegd, moet het worden geretourneerd met de tag in het origineel.',
                'returnPolicyContain6': 'Schoonheid en cosmetische producten moeten ongeopend en ongebruikt worden geretourneerd, waarbij de afdichtingen van elke verpakking nog intact zijn.',
                'returnPolicyContain7': 'Hosiery-, lingerie- en badkledingartikelen moeten worden geretourneerd met de hygineafdichtingen bevestigd en in ongeopende en onbeschadigde productverpakking, waar van toepassing.',
                'returnPolicyContain8': 'Lingerie en badkleding mogen alleen worden berecht over je eigen onderkleding. We zullen geen rendementen accepteren die zijn gedragen of vervuild zijn.',
                'returnPolicyContain9': 'Gezichtsmaskers moeten worden geretourneerd in hun originele, ongeopende en onbeschadigde productverpakking. Sieraden moeten in dezelfde staat worden geretourneerd waarin het is aangekomen, inclusief alle verpakkingen van merkbanden en documenten die ermee worden verstrekt.',
                'returnPolicyContain10': 'Please take care when trying on your purchases and return them in the same condition you received them. Any returns that do not meet our policy will not be accepted.',
                'returnPolicyContain11': 'Als u als gast een bestelling hebt geplaatst, kunt u hier uw terugkeer beginnen. Bekijk onze sectie Aangepaste items hieronder om een item te retourneren of te annuleren voor meer informatie.',
                'aboutUsText': 'Over ons',
                'aboutUsTitle': 'Wij zijn merk & labels',
                'aboutUsContain': 'Verken de beste merken van de wereld van \'s werelds',
                'aboutUsContain1': 'Brands & Labels is een top online luxe modebestemming met 5 miljoen bezoekers per maand en wereldwijde verzending.',
                'aboutUsContain2': 'De website biedt de beste selectie van de best gevestigde ontwerpers en jonge opkomende talenten. Brandslabels werd in de vroege jaren 1930 opgericht in Florence, met de opening van de gelijknamige conceptwinkel van het bedrijf via Roma. Online sinds 1999 schrijft het bedrijf 90% van de totale omzet toe aan online omzet. Tot op de dag van vandaag blijft het een 100% particulier familiebedrijf, met de kleinzoon van de oprichter, Andrea Panconesi als CEO en zijn dochter, Annagreta Panconesi als creatief directeur.',
                'aboutUsContain3': 'De site biedt een brede selectie kleding, schoenen, tassen, accessoires, luxe thuisinterieurs en schoonheid, met producten die beschikbaar zijn voor mannen, vrouwen en kinderen van de meest prestigieuze ontwerpers zoals Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus en meer.',
                'aboutUsContain4': 'Er zijn momenteel 200 mensen uit 15 verschillende landen die werken aan het produceren en onderhouden van BrandSlabels. De site is beschikbaar in 9 talen: Engels, Italiaans, Duits, Chinees, Russisch, Spaans, Frans, Koreaans en Japans. De site is volledig in eigen huis gemaakt, met het grafisch ontwerp van Florence Office, IT, klantenservice, marketing- en koopafdelingen. De stylisten en persteams werken vanuit het BrandSlabels -kantoor in de modehoofdstad van de wereld - Milaan.',
                'aboutUsContain5': 'Alle bestellingen worden wereldwijd verzonden vanuit het hoofdkantoor van de Brands Labels in dozen die worden bereid met maximale zorg en de beste materialen gebruiken, van de kenmerkende schoenzakken tot het gepersonaliseerde lint.',
                'aboutUsContain6': 'Brandslabels had in 2008 1,5 miljoen unieke bezoekers toegang tot de site en is in 2017 gegroeid tot 53 miljoen unieke bezoekers. Meer dan 15% van de online verkopen wordt gegenereerd uit de Verenigde Staten, gevolgd door Duitsland, VK, Itali, China en Frankrijk.',
                'aboutUsContain7': 'Brandslabels verlegt de grenzen van het luxe retaillandschap zowel aan als offline met een scala aan exclusieve diensten en handelsmerkinitiatieven, waaronder Buy It First, Luxury Club, Sneakers Club, LVR Privilege en LVR -edities.',
