                'positiveImpactSustainability': 'Positieve impact + duurzaamheid',
                'thereAreStillMoreThanMSG': 'Er zijn nog steeds meer dan een miljard mensen rond de wereld die in extreme armoede leven op minder dan \$ 1,25 per dag. Alleen al in Thailand bestaan er meer dan een miljoen leden van Hill Tribes in de marge van de samenleving - ontkend burgerschap, buitengesloten van de formele arbeidsmarkt en kwetsbaar voor uitbuiting en mensenhandel.',
                'atYellowLeafHammocksMsg': 'Bij gele bladhangmatten geloven we dat het creren van ethische banen een empowerment is voor langdurige oplossing voor extreme armoede.',
                'insteadOfOrganizingMsg': 'In plaats van een lappendeken van liefdadigheidsdonaties te organiseren om water, voeding, kleding, enz. Te bieden, werken we rechtstreeks samen met gezinnen om een uitgebreide, waardige, langetermijnstrategie op te bouwen naar een betere toekomst. De oorzaken achter systemische armoede zijn ingewikkeld, maar de financile stabiliteit op lange termijn is binnen handbereik.',
                'toPutItSimplyMsg': 'Simpel gezegd: door ons te concentreren op middelen van bestaan, kunnen we de middelste man uitsnijden, geld rechtstreeks in handen krijgen van slimme + vindingrijke moeders en gezinnen in staat stellen hun eigen problemen aan te pakken (zonder onderworpen te zijn aan de agenda van iemand anders).',
                'acrossThreeWeavingCommunitiesMsg': 'In drie wevende gemeenschappen werken we om banen voor moeders te creren en een basis te leggen voor positieve gemeenschapstransformatie. Door flexibel, veilig \"welvaartsloon\" weven werk, kunnen onze ambachtslieden hun families ophalen van armoede en schuldenslavernij naar de middenklasse.',
                'creatingJobsForWomenMsg': '** Het creren van banen voor vrouwen is vooral belangrijk voor gemeenschapstransformatie - onderzoek toont aan dat vrouwen tot 90% van hun inkomsten zullen uitgeven aan de gezondheid, voeding en onderwijs van hun families. Het veranderen van vrouwen in kostwinners verbetert hun status in de gemeenschap, bouwt zelfrespect op en stelt hen in staat middelen te bundelen om de infrastructuur te verbeteren.',
                'theFoundationForABrighterFuter': 'De basis voor een helderdere mutter',
                'theSecurityOfAStableMsg': 'De veiligheid van een stabiele, groeiende inkomstenbron had een enorme impact op het dorp. De Mlabri konden een school starten en een gemeenschapscentrum bouwen voor weven en socialiseren. Ze vestigden een van de eerste werkloosheidsfondsen van Thailand. Met een verhoogde economische macht lobbyden ze met succes voor burgerschap en burgerrechten, die ze voor het eerst werden verleend in 2001. Hangmatweven is flexibel werk, ideaal voor moeders die vanuit huis kunnen werken en hun eigen schema\'s kunnen maken. Helaas was de vraag naar hangmatten zonder toegang tot de wereldmarkten beperkt tot het Thaise toeristische seizoen en was er geen manier om het hele jaar door te zorgen.',
                'spreadingLastingChangeTheHammockRrevolution': 'Verspreiding van duurzame verandering: de hangmat -revolutie',
                'thisIsAboutWhereMsg': 'Dit gaat over waar Yellow Leaf lid wordt van het verhaal! In de afgelopen jaren hebben we gewerkt om consistente verkoopkanalen te ontwikkelen, internationale partnerschappen op te bouwen en activiteiten in de dorpen te stabiliseren.',
                'corollaryEconomicMsg': 'Corollary economische kansen, zoals een postkantoor, voedselbereiding en duurzame koffielandbouw, zijn ontstaan om mensen in dienst te nemen die niet weven. Onze samenwerking met Kiva heeft de financile training en financile planning gestimuleerd, met veel wevers die bankrekeningen voor het eerst in hun leven openen!',
                'wWithOurGrowthMsg': 'Omdat onze groei blijft versnellen, zullen we niet alleen het hele jaar door alle Mlabri-wevers kunnen gebruiken, we kunnen ook blijven uitbreiden en training en voortdurende werkgelegenheid bieden aan Hill Tribe Communities in de omliggende regio. Totdat het weven van werk en duurzame banen in het hele gebied beschikbaar zijn, zullen destructieve landbouwpraktijken doorgaan en zal de uitbuitingscyclus van contractarbeid niet echt eindigen.',
                'throughTheEstablishmentMsg': 'Door de oprichting van Yellow Leaf als een wereldwijd lifestyle -merk, zullen de Hill Tribe -dorpen waarmee we samenwerken in staat zijn om deze positieve impact te behouden en de basis te blijven leggen voor een betere toekomst.',
