                'charityContain1solo': 'Wanneer u bij ons koopt, helpt u een droom te ondersteunen Een droom om een veilige toekomst een gelukkige omgeving en een gezond leven te geven.',
                'charityContain2solo': 'Hoop is ons project om hoop en kansen te geven aan degenen die het het meest nodig hebben. Elke dollar die u op onze site uitgeeft - helpt bij het verbeteren van een leven ergens, van Syrische vluchtelingen tot het opleiden van kinderen in Afrika of het bieden van schoon water, we wensen en hopen de wereld een meer gelijke plaats te maken.',
                'charityContain3solo': '2% van elke verkoop die op onze website is gemaakt, helpt mensen die het meest nodig zijn. U kunt er ook voor kiezen om bij te dragen aan een verder bedrag dat we zullen matchen naast onze 2% - tot een maximum van 5% van de bestelwaarde.',
                'charityContain4solo': 'Bovendien? Je wordt door ons bijgewerkt over de donatie in alle mogelijke details en je weet waar het geld is uitgegeven en hoe het een leven heeft veranderd.',
