                'descriptionavoirchic': 'Meer informatie',
                'aboutUsTitleavoirchic': 'Avoirchic is een top online luxe modebestemming met 5 miljoen bezoekers per maand en wereldwijde verzending.',
                'aboutUsContainavoirchic': 'De website biedt de beste selectie van de best gevestigde ontwerpers en jonge opkomende talenten. Brandslabels werd in de vroege jaren 1930 opgericht in Florence, met de opening van de gelijknamige conceptwinkel van het bedrijf via Roma. Online sinds 1999 schrijft het bedrijf 90% van de totale omzet toe aan online omzet. Tot op de dag van vandaag blijft het een 100% particulier familiebedrijf, met de kleinzoon van de oprichter, Andrea Panconesi als CEO en zijn dochter, Annagreta Panconesi als creatief directeur.',
                'aboutUsContain1avoirchic': 'De site biedt een brede selectie kleding, schoenen, tassen, accessoires, luxe thuisinterieurs en schoonheid, met producten die beschikbaar zijn voor mannen, vrouwen en kinderen van de meest prestigieuze ontwerpers zoals Balenciaga, Vetements, Off-White, J.W. Anderson, Balmain, Dolce & Gabbana, Gucci, Saint Laurent, Valentino, Givenchy, Loewe, Jacquemus en meer.',
                'aboutUsContain2avoirchic': 'Er zijn momenteel 200 mensen uit 15 verschillende landen die werken aan het produceren en onderhouden van BrandSlabels. De site is beschikbaar in 9 talen: Engels, Italiaans, Duits, Chinees, Russisch, Spaans, Frans, Koreaans en Japans. De site is volledig in eigen huis gemaakt, met het grafisch ontwerp van Florence Office, IT, klantenservice, marketing- en koopafdelingen. De stylisten en persteams werken vanuit het BrandSlabels -kantoor in de modehoofdstad van de wereld - Milaan.',
                'aboutUsContain3avoirchic': 'Alle bestellingen worden wereldwijd verzonden vanuit het hoofdkantoor van het Brandslabels in dozen die worden bereid met maximale zorg en de beste materialen gebruiken, van de kenmerkende schoenzakken tot het gepersonaliseerde lint.',
                'aboutUsContain4avoirchic': 'Brandslabels had in 2008 1,5 miljoen unieke bezoekers toegang tot de site en is in 2017 gegroeid tot 53 miljoen unieke bezoekers. Meer dan 15% van de online verkopen wordt gegenereerd uit de Verenigde Staten, gevolgd door Duitsland, VK, Itali, China en Frankrijk.',
