  LanguageConstants(Locale locale) {
    _locale = locale;
    _localizedValues = {};
  }

  static late Locale _locale;

  static String _getText(String key) =>
    _localizedValues[key] ?? '** $key not found';

  static Locale get currentLocale => _locale;

  static String get currentLanguage => _locale.languageCode;

  /// Returns a map of loca maps per locale
  /// 
  /// ```dart
  /// {
  ///   'en': {'test': 'Hello world!'},
  ///   'de': {'test': 'Hallo welt!'},
  /// }
  /// ```
   static Map<String, Map<String, String>> get localeMaps {
    final returnMap = <String, Map<String, String>>{};
    _allValues.forEach(
      (key, value) => returnMap[key] = Map<String, String>.from(value),
    );
    return returnMap;
  }

  static Future<LanguageConstants> load(Locale locale) async {
    final translations = LanguageConstants(locale);
    _localizedValues = _allValues[locale.toString()]!;
    return translations;
  }
}

class LanguageConstantsDelegate extends LocalizationsDelegate<LanguageConstants> {
  const LanguageConstantsDelegate();

        static final Set<Locale> supportedLocals = {
Locale('en'),
Locale('es'),
Locale('ru'),
Locale('ko'),
Locale('ja'),
Locale('it'),
Locale('de'),
Locale('fr'),
Locale('nl'),
Locale('zh'),
Locale('ar'),
Locale('ur'),
};
      
      @override
      bool isSupported(Locale locale) => supportedLocals.contains(locale);
      

  @override
  Future<LanguageConstants> load(Locale locale) => LanguageConstants.load(locale);

  @override
  bool shouldReload(LanguageConstantsDelegate old) => false;
}

